import React from 'react';
import {useLocation} from 'react-router-dom';

export default function NoMatch() {
    let location = useLocation();
    return (
      <div className="lg">
        <h3>
          No match for <code>{location.pathname}</code>
        </h3>
      </div>
    );
}
